import React from "react";

const Home = () => {
  let financialData = [
    { spend: 245.0, date: "01-01-2022" },
    { spend: 821.0, date: "03-01-2022" },
    { spend: 447.0, date: "04-01-2022" },
  ];

  return <div className="w-50 bg-dark">Home</div>;
};

export default Home;
